-- Insert nearest postcode for each location where the lat/long is not a dummy value
IF EXISTS (SELECT 1 FROM dbo.VenueLocation HAVING Count(*) = Sum(CASE WHEN NearestPostcode IS NULL THEN 1 ELSE 0 END))
BEGIN
	/*
		-- Data calculated using the following unoptimized code
		DECLARE @MyCursor CURSOR;
		DECLARE @VenueLocationId int, @LocationName nvarchar(4000), @Latitude float, @Longitude float, @Point geography, @PostCode nvarchar(10);
		BEGIN
			SET NOCOUNT ON

			SET @MyCursor = CURSOR FOR
				SELECT VenueLocationId, LocationName, Latitude, Longitude
				FROM VenueLocation
				WHERE Convert(decimal(10, 6), Longitude) != -7.557149
					AND Convert(decimal(10,6), Latitude) != 49.766821
					AND NearestPostCode IS NULL

			OPEN @MyCursor 
			FETCH NEXT FROM @MyCursor 
				INTO @VenueLocationId, @LocationName, @Latitude, @Longitude

			WHILE @@FETCH_STATUS = 0
			BEGIN
		
				SET @Point = GEOGRAPHY::STGeomFromText('POINT(' + CAST(@Longitude AS VARCHAR(20)) + ' ' + CAST(@Latitude AS VARCHAR(20)) + ')', 4326);

				PRINT 'Looking for ' + @LocationName

				SELECT @Postcode = r.pcds
				FROM (
					SELECT TOP(1) pcds, @Point.STDistance(GEOGRAPHY::STGeomFromText('POINT(' + CAST(long AS VARCHAR(20)) + ' ' + CAST(lat AS VARCHAR(20)) + ')', 4326)) as distance
					FROM ONS_PostCodeDirectory.dbo.PostCode
					WHERE NOT (lat = 100 AND long = 0)
					ORDER BY distance 
				) r;

				UPDATE dbo.VenueLocation
				SET NearestPostCode = @PostCode
				WHERE VenueLocationId = @VenueLocationId;

				PRINT 'Found ' + @Postcode
				PRINT ''

			  FETCH NEXT FROM @MyCursor 
				INTO @VenueLocationId, @LocationName, @Latitude, @Longitude
			END; 

			CLOSE @MyCursor ;
			DEALLOCATE @MyCursor;
		END;
	*/

